const ArrowComponent = (props) => {

    const [count, setCount] = useState(0);

    const array = [
        'test 1',
        'test 2',
        'test 3',
        'test 4',    
    ];

    function handleClick () {
        setCount(count + 1)
    }

    return (
        <div>
            <div>{props.message} <b>{count}</b></div>
            <small>{props.text}</small>
            <div>
                <button onClick={handleClick}>
                    <h2>Add 1</h2>
                </button>
            </div>
